import React from "react";
import { styled } from "@mui/material/styles";

const Hoe = styled("div")(({ theme }) => ({
  fontSize: "70px",
  [theme.breakpoints.down("sm")]: {
    fontSize: "20px",
    color: "red",
  },
}));

function Home() {
  return (
    <div>
      <Hoe>hii iam nithi</Hoe>
    </div>
  );
}

export default Home;
